import React from 'react';
import './App.css';
import Membre from './components/Membre'
import "../public/css/style.css";


function App() {
  return (
    <div className="App">
      <h1>Gooder app</h1>
      <Membre name='Mickael'/>
      <Membre name='Meir'>
        <strong>je suis le 5e enfant</strong>
      </Membre>
    </div>
  );
}

export default App;
